// Quick test to isolate the hanging issue
const fetch = require('node-fetch');

console.log('Testing API key...');
const apiKey = 'sk-ad9404d1ced5426082b73e685a95ffa3';

if (!apiKey) {
  console.log('API key missing');
  process.exit(1);
}

console.log(`API key present: ${apiKey.substring(0, 6)}...`);

// Test DashScope API directly
async function testAPI() {
  try {
    console.log('Making request to DashScope...');

    const response = await fetch('https://dashscope-intl.aliyuncs.com/compatible-mode/v1/chat/completions', {
      method: 'POST',
      headers: {
        'Authorization': `Bearer ${apiKey}`,
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        model: 'qwen-mt-turbo',
        messages: [{
          role: 'user',
          content: 'hello'
        }],
        translation_options: {
          source_lang: 'English',
          target_lang: 'Spanish'
        }
      }),
    });

    console.log(`Response status: ${response.status}`);

    if (!response.ok) {
      const errorText = await response.text();
      console.error('API Error:', errorText);
      return;
    }

    const data = await response.json();
    console.log('Success:', data);

  } catch (error) {
    console.error('Request failed:', error);
  }
}

testAPI();
